            <NavDropdown.Item href="/about">About Us</NavDropdown.Item>
            <NavDropdown.Item href="/join">Join DeBest Robotics</NavDropdown.Item>
            <NavDropdown.Item href="/awards">Awards</NavDropdown.Item>
